package com.zepan.android.sdk.entity;/** * 用户对象 * */public class User {	/** 邮箱，也是是登录名 */	private String email;	/** 密码，md5加密后的 */	private String password;	/** 手机号 */	private String mobile;	/** 昵称 */	private String nickName;	public String getEmail() {		return email;	}	public void setEmail(String email) {		this.email = email;	}	public String getPassword() {		return password;	}	public void setPassword(String password) {		this.password = password;	}	public String getMobile() {		return mobile;	}	public void setMobile(String mobile) {		this.mobile = mobile;	}	public String getNickName() {		return nickName;	}	public void setNickName(String nickName) {		this.nickName = nickName;	}}